tinymce.PluginManager.add('solutionselements', function (editor, url) {
    //path to plugin
    var path = tinymce.baseURL + '/plugins/solutionselements/';
    var futherreadingbutton = path + 'further-reading-btn.png';
    var clearbothbutton = path + 'clear-both-btn.png';
    var smspacerbutton = path + 'spacer-small-btn.png';
    var mdspacerbutton = path + 'spacer-medium-btn.png';
    var lgspacerbutton = path + 'spacer-large-btn.png';
    var welljumbotronbutton = path + 'Well-Jumbotron-btn.png';
    var thumbnailbutton = path + 'thumbnail.png';
    var delselectedbutton = path + 'cross.png';
    var insertbutton = path + 'insert.png';
    var insertatendbutton = path + 'insertatend.png';

    ['h1', 'h2', 'h3', 'p', 'div'].forEach(function (name) {
        editor.addButton("style-" + name, {
            tooltip: "Toggle " + name,
            text: name.toUpperCase(),
            onClick: function () { editor.execCommand('mceToggleFormat', false, name); },
            onPostRender: function () {
                var self = this, setup = function () {
                    editor.formatter.formatChanged(name, function (state) {
                        self.active(state);
                    });
                };
                editor.formatter ? setup() : editor.on('init', setup);
            }
        })
    });

    editor.addMenuItem('viewpage', {
        text: 'Live Page',
        context: 'view',
        onclick: function () {
            if (editor.isDirty()) {
                alert("Save first!");
            } else {
                //get the system name fromn the iframe parent document
                var sn = jQuery('#SystemName', window.parent.document).val();
                //format it into a url
                var sn_arr = sn.split('.');
                sn_arr.pop();
                sn = sn_arr.join('/');
                window.parent.location = '/' + sn;
            }
        }
    });
    

    //add or update edited date when clicking outside of the editor (e.g, the save button)
    //todo would be better to remove on focus, and add on blur
    editor.on('focus', function (e) {
        editor.dom.remove(editor.dom.select('a.last-edit-date'));
    });

    editor.on('blur', function (e) {
        var d = new Date();
        var url = (window.location != window.parent.location)
            ? document.referrer
            : document.location.href;
        var date = "This page was updated: " + d.getDate() + "/" + (d.getMonth() + 1) + "/" + d.getFullYear();
        var el = editor.dom.get('last-edit-date');
        editor.dom.add(editor.getBody(), 'a', { id: 'last-edit-date', style: 'display: none', href: url, class: 'last-edit-date' }, date);
    });

    editor.addButton('furtherreadingbtn', {
        tooltip: 'Add a Further Reading button',
        image: futherreadingbutton,
        onclick: function () {
            // Open window
            editor.selection.setContent('<div class="further-reading-container"><a class="further-reading-button" title="" href="#">Link </a></div>');
        }
    });

    editor.addButton('clearbothbtn', {
        tooltip: 'Clear Floats (Start on a fresh row)',
        image: clearbothbutton,
        onclick: function () {
            // Open window
            editor.selection.setContent('<p style="clear:both; width: 100%; height:0; display:block">&nbsp;</p><br>&nbsp;');
        }
    });

    editor.addButton('smspacerbtn', {
        tooltip: 'Add a small vertical spacer',
        image: smspacerbutton,
        onclick: function () {
            // Open window
            editor.selection.setContent('<p style="clear:both; width: 100%; height:15px; display:block">&nbsp;</p><br>&nbsp;');
        }
    });

    editor.addButton('mdspacerbtn', {
        tooltip: 'Add a medium vertical spacer',
        image: mdspacerbutton,
        onclick: function () {
            // Open window
            editor.selection.setContent('<p style="clear:both; width: 100%; height:30px; display:block">&nbsp;</p><br>&nbsp;');
        }
    });

    editor.addButton('lgspacerbtn', {
        tooltip: 'Add a large vertical spacer',
        image: lgspacerbutton,
        onclick: function () {
            // Open window
            editor.selection.setContent('<p style="clear:both; width: 100%; height:60px; display:block">&nbsp;</p><br>&nbsp;');
        }
    });

    editor.addButton('hrbtn', {
        tooltip: 'Add a horizonal rule',
        text: "HR",
        onclick: function () {
            // Open window
            editor.selection.setContent('<hr>');
        }
    });

    editor.addButton('delselectedbtn', {
        image: delselectedbutton,
        tooltip: 'Delete the selected item',
        onclick: function () {
            var el = jQuery(tinymce.activeEditor.selection.getNode());
            jQuery(el).remove();
        }
    });

    editor.addButton('endbtn', {
        image: insertatendbutton,
        tooltip: 'Add content at the end',
        onclick: function () {
            editor.dom.add(editor.getBody(), 'div', {class: 'end-content'}, '&nbsp;');
        }
    });
    editor.addButton('insertbtn', {
        image: insertbutton,
        tooltip: 'Insert content after current row',
        onclick: function () {
            var el = jQuery(tinymce.activeEditor.selection.getNode()).closest('.row');
            el.after('<div>&nbsp;</div>');
        }
    });


    editor.addMenuItem('jumbotron', {
        image: welljumbotronbutton,
        text: 'Jumbotron (background container)',
        context: 'tools',
        onclick: function () {
            var html = '<div class="jumbotron"><div class="container">&nbsp;</div></div>';
            editor.selection.setContent(html);
        }
    });

    editor.addMenuItem('well', {
        image: welljumbotronbutton,
        text: 'Well (element with inset effect)',
        context: 'tools',
        onclick: function () {
            var html = '<div class="well">&nbsp;</div>';
            editor.selection.setContent(html);
        }
    });

    editor.addButton('thumbnail', {
        image: thumbnailbutton,
        tooltip: 'Thumbnail (Hyperlinked element with border effect)',
        onclick: function () {
            var html = '<a href="#" class="user-added thumbnail"><img src="data:image/png;base64," alt="Image description"  style="margin:0; max-width:100%;  width:100%; height: auto" ></a>';
            editor.selection.setContent(html);
        }
    });


});
